"tags":[]},"outputs":[],"source":["datos <- iris\n","alfa <- 0.7\n","# semilla de generación\n","set.seed(100)\n","# número total de filas\n","size.total <- nrow(datos)\n","# número de filas del set de entrenamiento\n","size.train <- round(size.total*alfa)\n","# vector de índices de las filas del set de entrenamiento con muestreo aleatorio sin reemplazo\n","datos.indices <- sample(1:size.total, size=size.train)\n","# creación del set de entrenamiento a partir del vector de índices datos.indices\n","datos.train <- datos[datos.indices,]\n","# creación del set de prueba a partir de los índices que no forman parte del vector datos.indices\n","datos.test <- datos[-datos.indices,]"]},{"cell_type":"code","execution_count":4,"id":"ac186f7d","metadata":{"execution":{"iopub.execute_input":"2023-11-22T02:14:07.527288Z","iopub.status.busy":"2023-11-22T02:14:07.525386Z","iopub.status.idle":"2023-11-22T02:14:07.553938Z","shell.execute_reply":"2023-11-22T02:14:07.551493Z"},"papermill":{"duration":0.037885,"end_time":"2023-11-22T02:14:07.556754","exception":false,"start_time":"2023-11-22T02:14:07.518869","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 6 × 5</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>Sepal.Length</th><th scope=col>Sepal.Width</th><th scope=col>Petal.Length</th><th scope=col>Petal.Width</th><th scope=col>Species</th></tr>\n","\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;fct&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><th scope=row>102</th><td>5.8</td><td>2.7</td><td>5.1</td><td>1.9</td><td>virginica </td></tr>\n","\t<tr><th scope=row>112</th><td>6.4</td><td>2.7</td><td>5.3</td><td>1.9</td><td>virginica </td></tr>\n","\t<tr><th scope=row>4</th><td>4.6</td><td>3.1</td><td>1.5</td><td>0.2</td><td>setosa    </td></tr>\n","\t<tr><th scope=row>55</th><td>6.5</td><td>2.8</td><td