l valor de la tercer fila es el porcentaje de la población que representa ese nodo\n","\n","El nodo 1 representa 100% de los datos\n","\n","### Resultados\n","\n","Si recorremos el árbol de decisión primero nos preguntamos si el pétalo de la flor en cuestión tiene un ancho menor a 0.8, si es así, se calcula una probabilidad de 100% de que la flor es \"setosa\" (nodo 2)\n","\n","Si la flor no tiene un ancho mayor a 0.8, hay 49% de probabilidad de que sea \"versicolor\" y 51% de que sea \"virginica\" (nodo 3).\n","\n","Ahora nos preguntamos si el petalo de la flor es menor a 1.8, si es así, se calcula una probabilidad de 89% de que la flor sea \"versicolor\" y 11% de que sea \"virginica\" (nodo 6)\n","\n","Si el ancho del pétalo no es menor a 1.8 hay 3% de probabilidad de que sea \"versicolor\" y 97% de que sea \"virginica\" (nodo 7)."]},{"cell_type":"markdown","id":"5700c0ed","metadata":{"papermill":{"duration":0.006368,"end_time":"2023-11-22T02:14:08.201281","exception":false,"start_time":"2023-11-22T02:14:08.194913","status":"completed"},"tags":[]},"source":["## Predicciones del set de prueba\n"]},{"cell_type":"markdown","id":"cf80992b","metadata":{"papermill":{"duration":0.006268,"end_time":"2023-11-22T02:14:08.2138","exception":false,"start_time":"2023-11-22T02:14:08.207532","status":"completed"},"tags":[]},"source":["En este paso utilizamos la función `predict` para hacer predicciones sobre los valores del tipo de flor (`Species`) en el set datos de prueba utilizando el arbol de clasificación."]},{"cell_type":"code","execution_count":8,"id":"4810b140","metadata":{"execution":{"iopub.execute_input":"2023-11-22T02:14:08.230753Z","iopub.status.busy":"2023-11-22T02:14:08.228968Z","iopub.status.idle":"2023-11-22T02:14:08.257924Z","shell.execute_reply":"2023-11-22T02:14:08.256098Z"},"papermill":{"duration":0.040164,"end_time":"2023-11-22T02:14:08.260324","exception":false,"start_time":"2023-11-22T02:14:08.22016","status":"completed"},"tags":[]},"outputs":[{"data":{"te